  true,\n\t\"url\": null,\n\t\"notes\": \"Total and methyl mercury, moisture content
  (%), and porosity were measured in Lake Michigan sediment by the U.S. Environmental
  Protection Agency/Office of Research and Development/National Health and Environmental
  Effects Research Laboratory/Mid-Continent Ecology Division/Large Lakes Research
  Station, Grosse Ile, MI. Both core and Ponar grab samples were collected. The samples
  were collected from 1994 through 1996. These mercury data were used in the LM2-Mercury
  model. nnThis dataset is associated with the following publication:nZhang, X., K.
  Rygwelski , M. Rowe, R. Rossmann, and R. Kreis. Global and regional contributions
  to total mercury concentrations in Lake Michigan water.   JOURNAL OF GREAT LAKES
  RESEARCH. International Association for Great Lakes Research, Ann Arbor, MI, USA,
